  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <h1>
          Edit <code>src/App.js</code> and save to reload.
        </h1>
        <h2>
          Edit <code>src/App.js</code> and save to reload.
        </h2>
        <Button variant="light">Click me to change the color of </Button>
      </header>
    </div>
  );
}

export default App;
